import React, {Â Component } from 'react';
import { Link } from 'react-router-dom';


class Menu extends Component{
	render(){

        let { lang } = this.props;

		return (
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="collapse navbar-collapse" id="navbarNavDropdown">
                    <ul className="navbar-nav">
                        <li className="nav-item "><Link to={`${lang}`}>Home</Link></li>
                        <li className="nav-item "><Link to={`${lang}/about`}>About</Link></li>
                        <li className="nav-item "><Link to={`${lang}/topics`}>Topics</Link></li>
                        <li className="nav-item "><Link to={`${lang}/contacts`}>Contacts</Link></li>
                    </ul>
                </div>
            </nav>
		);
	}
}	

export default Menu;
